import React from 'react';
import {Yoga} from '../Menulisters/MenuList';
import '../styles/Menu.css';

function Menu() {
  return (
    <div className='menu'>
    <h1 className='ourTitle'>our menu</h1>
    {/*using array for image  */}
    <div className='menuList'>
    {Yoga.map((menuItem, key)=>{
        return
        <div className='menuItem' key={key}>
        <img src={menuItem.image} alt={menuItem.name} />
        <h2>{menuItem.name}</h2>
        <p>{menuItem.description}</p>
        </div>
    } )}

    </div>

    </div>
  )
}

export default Menu
